import React from 'react';
import './navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faBars, faCaretDown, faHome, faLink, faMoneyBill} from "@fortawesome/free-solid-svg-icons";


const navbar = () => {
    return ( 
        <div className={'Navbar'}>
            <div className={'LogoName'}> <FontAwesomeIcon icon={faBars}/><p>My First React Website</p> </div>
            <div className={'NavLinks'}>
                <div className={'NavLink'}><FontAwesomeIcon icon={faHome} style={{marginRight: 8}}/>Home<FontAwesomeIcon icon={faCaretDown} style={{marginLeft: 5, color: 'lightGrey'}}/></div>
                <div className={'NavLink'}><FontAwesomeIcon icon={faLink} style={{marginRight: 8}}/>Features<FontAwesomeIcon icon={faCaretDown} style={{marginLeft: 5, color: 'lightGrey'}}/></div>
                <div className={'NavLink'}><FontAwesomeIcon icon={faMoneyBill} style={{marginRight: 8}}/>Pricing<FontAwesomeIcon icon={faCaretDown} style={{marginLeft: 5, color: 'lightGrey'}}/></div>
                <button className="btn btn-light"><p>Buy Now</p></button>
            </div>
        </div>
     );
}

export default navbar;
